INSERT INTO comments VALUES ('41', '155', '<ul><li>先判断 id 是否为整数，如果不是就直接返回<code style=\"background-color: rgb(255, 245, 245); color: rgb(255, 80, 44);\">参数无效</code>。这里需要注意的是，路径参数本身的类型是一个字符串，它是一个字符串类型的整数，需要做下类型转换。</li><li>然后拿着这个 id 去数据库里面查找有没有这个项目，有就返回，没有就返回<code style=\"background-color: rgb(255, 245, 245); color: rgb(255, 80, 44);\">参数无效</code>。</li></ul><p><br></p>', 'zheng说：', '2019/12/18', '1', 'zheng');
INSERT INTO comments VALUES ('42', '155', '<p>不用返回非常明确的错误信息给客户端，因为这个信息有可能会被不法分子利用，他们会根据错误信息来猜测代码的具体实现从而试探可能存在的漏洞。详细的错误信息应该用 Log 记录下来，方便接口开发人员排查问题。比如大家登录一些网站的时候，会提示帐号或者密码不对，此时就不应该明确地告诉用户到底是帐号不对还是密码不对，接口开发人员有 Log 记录就可以了。</p><p><br></p><p>作者：云音乐前端技术团队</p><p>链接：https://juejin.im/post/5df82ec35188251231760ad2</p><p>来源：掘金</p><p>著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。</p>', 'zheng说：', '2019/12/18', '1', 'zheng');
INSERT INTO comments VALUES ('43', '155', '<p><strong>也就是说 不要太明确表示具体哪里出错了，用个模糊的错误信息返回给客户端就可以，详细的用log记录</strong></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('44', '155', '<p>添加一行，把整个数组传给后端，不要一个一个传</p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('45', '155', '<p><span style=\"color: rgb(51, 51, 51);\">服务端不应该完全信任客户端发送过来的数据，因为请求数据是可以通过工具来伪造的</span></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('46', '155', '<p><span style=\"color: rgb(51, 51, 51);\">因为数据可以伪造，所以后端是必须要进行数据校验的</span></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('47', '156', '<p>1.await后面不是Promise对象，直接执行</p><p>2.await后面是Promise对象会阻塞后面的代码，Promise 对象 resolve，然后得到 resolve 的值，作为 await 表达式的运算结果</p><p>3.所以这就是await必须用在async的原因，async刚好返回一个Promise对象，可以异步执行阻塞</p><p><br></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('48', '156', '<p><span style=\"color: rgb(26, 26, 26);\">用异步的 async/await 呢？在读取文件的 1 分钟时间里，Node.js 还可以接着响应其他请求，保证服务的可用。</span></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('51', '156', '<h1><a href=\"https://segmentfault.com/a/1190000007535316\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(33, 37, 41);\">理解 JavaScript 的 async/await</a>：<a href=\"https://segmentfault.com/a/1190000007535316\" rel=\"noopener noreferrer\" target=\"_blank\">https://segmentfault.com/a/1190000007535316</a></h1>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('52', '156', '<pre class=\"ql-syntax\" spellcheck=\"false\">每一个步骤都需要之前每个步骤的结果。\nfunction takeLongTime(n) {\n    return new Promise(resolve =&gt; {\n        setTimeout(() =&gt; resolve(n + 200), n);\n    });\n}\nfunction step1(n) {\n    console.log(`step1 with ${n}`);\n    return takeLongTime(n);\n}\n\nfunction step2(m, n) {\n    console.log(`step2 with ${m} and ${n}`);\n    return takeLongTime(m + n);\n}\n\nfunction step3(k, m, n) {\n    console.log(`step3 with ${k}, ${m} and ${n}`);\n    return takeLongTime(k + m + n);\n}\n\n\n\n\n\nasync function doIt() {\n    console.time(\"doIt\");\n    const time1 = 300;\n    const time2 = await step1(time1);\n    const time3 = await step2(time1, time2);\n    const result = await step3(time1, time2, time3);\n    console.log(`result is ${result}`);\n    console.timeEnd(\"doIt\");\n}\n\ndoIt();\n\n// c:var  est&gt;node --harmony_async_await .\n// step1 with 300\n// step2 with 800 = 300 + 500\n// step3 with 1800 = 300 + 500 + 1000\n// result is 2000\n// doIt: 2907.387ms\n</pre><p><br></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('55', '156', '<p><span style=\"background-color: rgba(246, 246, 246, 0.4); color: rgb(33, 37, 41);\">async 函数返回的是一个 Promise 对象，它会立即执行，不会阻塞，可以通过then获取返回值</span></p><p><span style=\"background-color: rgba(246, 246, 246, 0.4); color: rgb(33, 37, 41);\">await会阻塞，所以要放在async里面，这样就不会阻塞，又可以</span><span style=\"color: rgb(33, 37, 41);\">等着 Promise 对象 resolve</span></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('56', '157', '<p>浅拷贝</p><p><strong style=\"color: rgb(51, 51, 51);\" class=\"hljs-keyword\">let</strong><span style=\"color: rgb(51, 51, 51); background-color: rgb(248, 248, 248);\"> b = { ...a }</span></p><p><span style=\"background-color: rgb(248, 248, 248);\">b.age = </span><span class=\"hljs-number\" style=\"color: teal;\">2</span></p>', 'zheng说：', '2019/12/18', null, null);
INSERT INTO comments VALUES ('57', '157', '<p>深拷贝</p><p><span style=\"background-color: rgb(255, 245, 245); color: rgb(255, 80, 44);\">1、JSON.parse(JSON.stringify(a)) （</span><span style=\"color: rgb(51, 51, 51);\">递归浅拷贝</span><span style=\"background-color: rgb(255, 245, 245); color: rgb(255, 80, 44);\">）</span></p><p>2、<span style=\"color: rgb(51, 51, 51);\">&nbsp;loadash 中的&nbsp;</span><code style=\"color: rgb(255, 80, 44); background-color: rgb(255, 245, 245);\">cloneDeep（</code>性能不好<code style=\"color: rgb(255, 80, 44); background-color: rgb(255, 245, 245);\">，</code><span style=\"color: rgb(51, 51, 51);\">把整个对象都遍历一遍</span><code style=\"color: rgb(255, 80, 44); background-color: rgb(255, 245, 245);\">）</code></p>', 'zheng说：', '2019/12/18', null, null);
