INSERT INTO comments VALUES ('61', '170', '<pre class=\"ql-syntax\" spellcheck=\"false\">&lt;select id=\"getBidEfficiency\" resultType=\"com.jeeplus.modules.ggzy.entity.ValidApplyinfo\" statementType=\"STATEMENT\"&gt;\n   select unitname_single,count(distinct biaoduanguid) 投标次数\n    from valid_applyinfo\n    where biaoduanguid in (select distinct biaoduanguid\n    from ${bidType}\n   \n\n    where rownum&lt;![CDATA[&lt;=10]]&gt;\n&lt;/select&gt;\n</pre><p><br></p>', 'zheng说：', '2020/1/9', null, null);
INSERT INTO comments VALUES ('62', '172', '<p>imp bigdata191022/bigdata191022@183.239.33.103:15223/orcl file=E:DPFsqljzcxjzcx_02.dmp full=y fromuser=jzcx touser=bigdata191022</p><p>这样子会报错 警告: 这些对象由 SYS 导出, 而不是当前用户</p><p>去掉full=y就可以</p><p>因为f<span style=\"color: rgb(51, 51, 51);\">ull=y，是导入文件中全部内容，有可能有多个用户的内容。如果你联接的用户默认使用的表空间设置成system，则导入文件的内容会导到system上。</span></p>', 'zheng说：', '2020/1/16', null, null);
